	router.PUT(baseURL+"/api/info/auth", wrapper.InfoAuth)
	router.PUT(baseURL+"/api/info/claim-account", wrapper.InfoClaimAccount)
	router.GET(baseURL+"/api/info/company", wrapper.InfoCompany)
